<template>
	<view class="content">
		<view class="box">使用组件：可以使用 html 中的标签，但是不建议使用</view>
		<image src="../../static/logo.png" mode=""></image>
		<view class="box">使用vue语法：</view>
		<view>v-model</view>
		<view>msg: {{ msg }}</view>
		<input class="myinput" type="text" v-model="msg" />
		<view>v-bind</view>
		<image :src="url" mode=""></image>
		<view>v-if</view>
		<text v-if="gender">男</text>
		<text v-else>女</text>
		<view class="box">事件注册：</view>
		<button type="default" @click="fn">点我触发事件</button>
		<view class="box">调用小程序中的 api：</view>
		<button type="default" @click="showToast">点我显示弹框</button>
	</view>
</template>

<script>
	export default {
		data() {
			return {
				msg: 'msg',
				url: 'data:image/jpeg;base64,',
				gender: true
			}
		},
		onLoad() {

		},
		methods: {
			fn () {
				console.log('我是 fn 方法')
				console.log(this.msg)
			},
			showToast () {
				// 显示弹框：支持小程序中的 api （方法）
				// 使用 uni-app 时， uni-app 建议将 wx. 改为 uni.
				uni.showToast({
					title: '我是弹框'
				})
			}
		}
	}
</script>

<style>
	page {
		background-color: #ddd;
	}
	.box {
		font-size: 20px;
		font-weight: 700;
	}
	.myinput {
		border: 4px solid #007AFF;
	}
</style>
